import React,{Component} from 'react';

import './Brunch.css';

import photos from './Data/Data.js'
import Display from './Display.js'
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useParams,
  useRouteMatch
} from "react-router-dom";
import Page from './Page.js'
import Home from './Home.js'

class Brunch extends Component {

  render(){
  const photo = photos;

  return (     
          <div>   

            <div className="Page-Header"><p>brunch</p></div>
            <div class="row">

                {photo.map((e,i) =>
                    <Display 
                    color={e.color}
                    photo={e.photo}
                    name={e.text}
                    key={i}
                    url={e.url}

                    />
                )}

            </div>
          <Switch>
              <Route
                exact path={`/brunch/thegoodfork`}
              >
                <Page
                />
              </Route>
          {photo.map((route, index) => (
              // Render more <Route>s with the same paths as
              // above, but different components this time.
              <Route
                key={index}
                exact path={`/brunch/:${route.url}`}>
                  <Page 
                    color={route.color}
                    name={route.name}
                    relativeLocation={route.relativeLocation}
                    address={route.address}
                    commute={route.commute}
                    foodValue={route.foodValue}
                    blurb={route.blurb}
                    photos={route.photos}
                  />
              </Route>
            ))}
          </Switch>
          </div>
  );
    }
}

export default Brunch;
